import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M13.97 4.36A1.5 1.5 0 0011.5 5.5v4L5.47 4.35A1.5 1.5 0 003 5.5v13c0 .88.7 1.48 1.46 1.5h.09c.32 0 .64-.12.92-.36l6.03-5.13v3.99a1.5 1.5 0 002.47 1.14l7.41-6.3c.82-.7.82-1.97 0-2.67l-7.41-6.3z", fill: primaryFill }));
};
const FastForward24Filled = wrapIcon(rawSvg({}), 'FastForward24Filled');
export default FastForward24Filled;
